import React from 'react';
import './styles/DashboardContent.css'; // Import the CSS file

const DashboardContent = () => {
  return (
    <div className="dashboard-content">
      <div className="card">
        <h3>Candidate Overview</h3>
        <p>View and manage candidate applications.</p>
      </div>
      <div className="card">
        <h3>Interviewer List</h3>
        <p>Manage interviewers for the recruitment process.</p>
      </div>
      <div className="card">
        <h3>Reports</h3>
        <p>Generate and view reports on recruitment.</p>
      </div>
      <div className="card">
        <h3>Settings</h3>
        <p>Configure application settings.</p>
      </div>
      {/* Add more cards as needed */}
    </div>
  );
};

export default DashboardContent;
